import ShoesData from "./data.json"


export default class Home extends Component {
    data = ShoesData;
  render() {
    return (
      <div>
        <h1>My Shoes Store</h1>
        <div className='text-center'>
            <button className='btn btn-success'>
                Cart (0)
            </button>
        </div>
      </div>
    )
  }
}
